import React from 'react'
import { Link } from 'react-router-dom';


let title

const listItem = ({note}) => {
  return (
    <Link to={'/notes/'+note.id}>
      <div className="notes-list-item">
        <h3> {note.body} </h3>
      </div>
    </Link>
  )
}

export default listItem
